import logo from './logo.svg';
import './App.css';
import { Button } from 'reactstrap';
import { Container, Row, Col } from 'reactstrap';
import Widget from './Widgets/widget';
import Widget1 from './Widgets1/widget1';
import Widget2 from './Widgets2/widget2';
import Widget3 from './Widgets3/widget3';
import Widget4 from './Widgets4/widget4';
import Widget5 from './Widgets5/widget5';
import Menu from './Menu/menu';


class App extends Component {
  render() {
    return (

      <div className="App">
        <header className="App-header">
        <div className="container">
       <br></br>
          <img src={logo} className="App-logo" alt="logo" />

        <Menu/>
        <Row>
          <Col xs="6" sm="4">
          <Button color="danger"className="col-5">SALUT </Button> <b></b>
          </Col>
          <Col xs="6" sm="4">
          <Button color="danger"className="col-5">SALUT </Button> <b></b>
          </Col>
          <Col xs="6" sm="4">
          <Button color="danger"className="col-5">SALUT </Button> <b></b>
          </Col>
          </Row>  

        <div className="row">  
          <Widget className="col-2"/>

                </div>


          <div className="row">  
          <Widget1 className="col-9"></Widget1>
          <Widget2 className="col-3"></Widget2>
          <Widget3 className="col-9"></Widget3>
    </div>


          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
          </div>
        </header>

      </div>
    );
  }
}

export default App;
